import { useState } from "react";
import OverlayMenu from "./OverlayMenu";
import PlayOptions from "./PlayOptions";
import StartHeader from "./StartHeader";

function Flip() {
    const [isMenuActive, activeMenu] = useState(false);

    return (
    <div className="flip">
        <StartHeader onMenuClick={() => activeMenu(!isMenuActive)}/>
        <OverlayMenu 
            isMenuActive={isMenuActive}
            closeMenu={() => activeMenu(false)} 
        />
        <div id="side">
            <div id="sideText">Side: </div>
            <div id="sideChoice">heads/tails</div>
        </div>
        <div id="screenName">
            <div id="screenNameText">Screen Name: </div>
            <div id="screenNameInput">input box here</div>
        </div>
        <div id="wallet">
            <div id="walletText">Side: </div>
            <div id="walletInput">input box here</div>
        </div>
    </div>
    )
}

export default Flip;
